var formatoData={format:"dd/mm/yyyy",todayBtn:"linked",language:"pt-BR",autoclose:true,todayHighlight:true};function notificacao_alerta(a){var b=new PNotify({text:a,type:"warning",icon:false,mouse_reset:false});b.get().click(function(){b.remove()})}function notificacao_erro(a){var b=new PNotify({text:a,type:"erro",icon:false,mouse_reset:false});b.get().click(function(){b.remove()})}function notificacao_sucesso(a){var b=new PNotify({text:a,type:"success",icon:false,mouse_reset:false});b.get().click(function(){b.remove()})}function pegaData(b){var a=b.split("/");return new Date(a[2],a[1]-1,a[0])}function contarLetra(a,b){return a.split(b).length-1};